window.bookSummaryJSON = "<p><b>My cat is a demon.</b></p> <p>No, that's not a joke. An actual, real-life demon. And he needs my help to break a curse.</p> <p>But what happens when that turns into more?</p> <p>It can never be forever, and yet... I'm falling in love with him anyway.</p> <p>Spookily Yours <i>is a spicy, open-door Halloween-themed novel featuring a witch and the demon who falls in love with her. This book is book one in the Witches of Pleasant Grove series but can be enjoyed as a standalone. HEA guaranteed!</i></p>"; 
